package january19;

public class LogicalOperator {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		int a=10;
		int b=10;
		int c=20;
		int d=30;
		System.out.println((a==b)&&(d>c));
		System.out.println(a!=c|| a>b);
		boolean result=(a!=c|| a>b);
		System.out.println(result);
	}

}
